import "./App.css";
import { useEffect, useState } from "react";
import getGifts from "./services/getGifts";

export const Gif = ({ keyword }) => {
  const [gifs, setGifs] = useState([]);

  useEffect(function () {
    getGifts({ keyword })
    .then((gifs) => setGifs(gifs));
  }, [keyword]);

  return gifs.map(({ id, title, url }) => (
    <Gif
     id={id} 
     key={id} 
     title={title} 
     url={url} />
  ));
};
